const ProfileInfo = () => {
    return (
      <div>
        <div className={css.profile__top}>
          <img alt="img" src={props.photos.large}></img>
        </div>

        <div className={css.profile__info}>
          <ProfileAvatar/>
          <Description />
        </div>
    </div>
    )
}

export default ProfileInfo;
